import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import './App.css';

function Login({show,handleClose})
{
    return (
        <>
            <Modal show={show} onHide={handleClose} style={{ height:'700px' }} size="lg" >
                {/* <Modal.Header closeButton>
                </Modal.Header> */}

                <div style={{ display:'flex',flexDirection:'row' }}>
                    <Modal.Body style={{backgroundColor: '#013d62',width:'10%'}}>
                        <h3>Why Sign up?</h3>
                        <ul style={{ color:'white' }}>
                            <li>Exclusive deals</li>
                            <li>More Savings</li>
                            <li>Over 50 Stores</li>
                            <li>Over 100 Categories</li>
                        </ul>

                        <div style={{ backgroundImage: 'url(https://cdn.zoutons.com/images/common/login_bg.png)',backgroundRepeat:'no-repeat',height:'300px'}}>
                        </div>

                    </Modal.Body>

                    <Modal.Body style={{ backgroundColor: 'white'}}>



                    </Modal.Body>
                </div>                
                

            </Modal>
        </>
      );
}





export default Login;
